IE_FunctionalCookies=false;function setCookie(cname,cvalue,exdays){var d=new Date;d.setTime(d.getTime()+exdays*24*60*60*1e3);var expires="expires="+d.toUTCString();document.cookie=cname+"="+cvalue+";"+expires+";path=/"}function getCookie(cname){var name=cname+"=";var ca=document.cookie.split(";");for(var i=0;i<ca.length;i++){var c=ca[i];while(c.charAt(0)==" "){c=c.substring(1)}if(c.indexOf(name)==0){return c.substring(name.length,c.length)}}return""}function removeAdsPlaceholders(){$(".ad").hide()}async function loadAndExecuteScripts(scriptUrls,customFunction){try{async function loadScript(url){return new Promise((resolve,reject)=>{const script=document.createElement("script");script.src=url;script.async=true;script.onload=()=>resolve();script.onerror=()=>reject(new Error(`Failed to load script: ${url}`));document.head.appendChild(script)})}for(const url of scriptUrls){await loadScript(url)}customFunction()}catch(error){console.error("An error occurred while loading scripts:",error)}}